光の反射で美しく輝くスピン加工を施したアルミパネルが上質な、スマートフォン・タブレット用ＵＳＢカーチャージャー。<img src="http://image.rakuten.co.jp/cocodecow/cabinet/zaikocall.gif" width="303" height="100" border="0"><br />●入力電圧：ＤＣ１２Ｖ（マイナスアース車）●出力電流：２．１Ａ（ＭＡＸ）　●出力電圧：ＤＣ５Ｖ(ＭＡＸ)●コネクタ：入力／シガープラグ　、出力／ＵＳＢ　Ａコネクタ　メス●サイズ：幅２７×奥行４９×高さ２７ｍｍ●重量：約１３ｇ●適合車種：１２Ｖ～２４Vマイナスアース車※一部の輸入車など車種によってはシガーソケットのコネクタ形状が異なるので使用できません。●対応機種：Apple iPad・iPhone・iPod、各種スマートフォン、各種タブレット※入力が2.1A以下の機器。<BR><BR><BR><BR><BR>ＳＡＮＷＡＳＵＰＰＬＹ　携帯電話用充電器　充電器携帯用　車充電器　車用充電器　ＣＡＲＣＨＲ６８Ｕ　充電器　ｉＰａｄ　ｉＰｈｏｎｅ　ｉＰｏｄ　スマートフォン　タブレット<style type="text/css">
